// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Token.sol";

contract LiquidityPool is Ownable {
    Token public token;

    address public constant bankWallet = 0x650f14051E298EDC44dD7260f0E1d2a652457059; // 73% fee +  1.4211% royal
    address public feeWallet; // 27% fee

    address public constant airDropWallet = 0x650f14051E298EDC44dD7260f0E1d2a652457059; // 1.5789% royal
    address public gammaWallet; // 2% bonding curve royal
    address public deltaWallet; // 4% bonding curve royal

    event TokenBought(address indexed buyer, uint256 vtruAmount, uint256 tokenAmount);
    event TokenSold(address indexed seller, uint256 tokenAmount, uint256 vtruAmount);
    event FeeTransferred(address indexed from, address indexed to, uint256 amount);

    constructor(
        string memory _name,
        string memory _ticker,
        string memory _description,
        string memory _image,
        uint _totalSupply
    ) Ownable(msg.sender) {
        token = new Token(_name, _ticker, _description, _image);

        token.mint(bankWallet, getPercentOf(_totalSupply, 14211)); // 1.4211% royalty
        token.mint(airDropWallet, getPercentOf(_totalSupply, 15789)); // 1.5789% royalty
        token.mint(gammaWallet, getPercentOf(_totalSupply, 20000)); // 2% royalty for burn
        token.mint(deltaWallet, getPercentOf(_totalSupply, 40000)); // 4% royalty for burn

        token.mint(address(this), getPercentOf(_totalSupply, 910000)); // 91% to LP
    }

    function getPercentOf(uint _amount,  uint _percent) internal pure returns (uint) {
        return _amount / 100_0000 * _percent;
    }

    // function buyToken(uint256 vtruAmount) public {
    //     require(vtruAmount > 0, "Must provide VTRU to buy tokens");

    //     uint256 vtruReserve = vtruToken.balanceOf(address(this)) - vtruAmount;
    //     uint256 tokenReserve = token.balanceOf(address(this));
    //     uint256 tokenAmount = getOutputAmount(vtruAmount, vtruReserve, tokenReserve);

    //     vtruToken.transferFrom(msg.sender, address(this), vtruAmount);
    //     token.transfer(msg.sender, tokenAmount);

    //     emit TokenBought(msg.sender, vtruAmount, tokenAmount);
    // }

    // function sellToken(uint256 tokenAmount) public {
    //     require(tokenAmount > 0, "Must provide tokens to sell");

    //     uint256 fee = tokenAmount / 100;  // 1% fee
    //     uint256 tokenAmountAfterFee = tokenAmount - fee;

    //     uint256 vtruReserve = vtruToken.balanceOf(address(this));
    //     uint256 tokenReserve = token.balanceOf(address(this));
    //     uint256 vtruAmount = getOutputAmount(tokenAmountAfterFee, tokenReserve, vtruReserve);

    //     token.transferFrom(msg.sender, address(this), tokenAmountAfterFee);
    //     token.transferFrom(msg.sender, feeWallet, fee);
    //     vtruToken.transfer(msg.sender, vtruAmount);

    //     emit TokenSold(msg.sender, tokenAmountAfterFee, vtruAmount);
    //     emit FeeTransferred(msg.sender, feeWallet, fee);
    // }

    function getOutputAmount(uint256 inputAmount, uint256 inputReserve, uint256 outputReserve) internal pure returns (uint256) {
        require(inputReserve > 0 && outputReserve > 0, "Invalid reserves");

        uint256 inputAmountWithFee = inputAmount * 997;
        uint256 numerator = inputAmountWithFee * outputReserve;
        uint256 denominator = (inputReserve * 1000) + inputAmountWithFee;
        return numerator / denominator;
    }

    function getVtruBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function getTokenBalance() public view returns (uint256) {
        return token.balanceOf(address(this));
    }
}

contracts/Token.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Token is ERC20, Ownable {
    string public description;
    string public image;

    constructor(
        string memory _name,
        string memory _ticker,
        string memory _description,
        string memory _image
    ) Ownable(msg.sender) ERC20(_name, _ticker) {
        require(bytes(_description).length <= 250, "Description too long");
        // Image file size is not feasible to check directly in smart contract; using string for URI
        // require(bytes(_image).length <= 250 * 1024 * 1024, "Image file size too large");

        description = _description;
        image = _image;
    }

    function mint(address _to, uint256 _amount) public onlyOwner {
        _mint(_to, _amount);
    }
}

